import React, {Component} from 'react'

class Body extends Component {
	render() {
		return (
			<div>
				<h1 className='text-3xl font-bold underline'>
					Hello, World!
					ช็อคโกแลตปั่นแสนอร่อยของน้องเน้ก
				</h1>
			</div>
		);
	}
}

export default Body
